import Sidebar from './Sidebar'
import '../style/App.scss';
import { Outlet } from 'react-router-dom';

const Layout = () => {
    return (
        <div className='App'>
            <Sidebar />
            <div className='tags-area'>
            <span className="tags tags-top-html">&lt;html&gt;</span><br />
                <span className='tags tags-top-body'>&lt;body&gt;</span>

                <Outlet />

                <span className='tags'></span>
                <span className='tags-bottom-body'>&lt;/body&gt;
                <br />
                </span>
                <span className="tags-button-html">&lt;/html&gt;</span>
            </div>
        </div>
    )
}

export default Layout
